description:
With nothing but your instincts and your trusty Survival Spinner, do you have what it takes to make it out of the jungle alive? Find out in this latest adventure in the thrilling game-in-a-book series, Spin to Survive: Deadly Jungle!
Grandma Beatriz has given you an important mission: discover the fabled Lost City of the Jaguar God so it can be protected and preserved for the future. But lost and alone in the Amazon Rainforest, survival must be your top priority. Play your way through the deadly dangers of the Amazon in a fight for your life, facing off against treacherous river rapids, prowling jaguars, dastardly treasure-hunters and a whole host of hazards that dwell deep in the jungle.
How does it work?
	Read the story and decide what course to take.
	Place your Survival Spinner (included with this book!) on the circle, then SPIN TO SURVIVE!
	Follow the directions to the next stage of your adventure... or your grisly demise!
The exciting story is accompanied by expert survival tips and real-life accounts of people who survived in the wild, against the odds. Learn how to fashion a raft out of balsa wood, identify which fruits are edible and which are poison, and the traditional wisdom of the Indigenous peoples of the Amazon.
From bestselling author Emily Hawkins and with spectacular artwork by R. Fresson, children aged 7+ will love playing through this unique choose-your-own-adventure book again and again. Filled with fascinating non-fiction content and with all manner of outcomes awaiting you, Spin to Survive: Deadly Jungle is both a gorgeous reference book and an endlessly replayable adventure.
